import React from 'react';
import '../../App.css';
import * as ReactBootStrap from 'react-bootstrap';
import 'aos/dist/aos.css';



class Admin extends React.Component {
    constructor(props) {
        super(props);
        this.state = ({
            userid: '',
            password: '',
            isLoggedin: false,
        })
    }
    render() {
        return (
            <h1>Admin</h1>
        )
    }
}

export default Admin;
